  false,\n\t\"url\": null,\n\t\"notes\": \"Final report on a project at Madison Wetland
  Management District to implement a standardized decision making tool developed to
  prioritize Waterfowl Production Area's (WPA) for management.  Native prairie tracts
  and planted grasslands will be prioritized according to the potential for the tract
  to benefit waterfowl and grassland birds. This strategic planning project enables
  the Service to make decisions on what habitats need protection and what landscapes
  have the greatest value to the health of waterfowl populations.\",\n\t\"license_title\":
